import React from 'react';

import { connect } from 'react-redux';


class Hello extends React.Component {
    constructor(props) {
        super(props);
        console.log(props.name);
    }

    render() {
        return (
            <div>
{props.name}
            </div>
        );
    }
}


export default connect(
    state => ({
        name: state.name
    }),
    dispath => ({
        onGetConnect: (MyParam) => { dispath({ type: 'default', name: MyParam }) }
    }
    )
)(Hello)
